import styles from "./Brand.module.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedinIn, faGithub } from "@fortawesome/free-brands-svg-icons";
import { faAt } from "@fortawesome/free-solid-svg-icons";

export const Brand = () => {
  return (
    <>
      <div className={styles.brand}>
        <div className={styles.brand__contact}>
          <FontAwesomeIcon
            icon={faLinkedinIn}
            // size="1.5x"
            className={styles.navbar__contact_icon}
          />
          <FontAwesomeIcon
            icon={faGithub}
            size="40%"
            className={styles.navbar__contact_icon}
          />
          <FontAwesomeIcon
            icon={faAt}
            size="40%"
            className={styles.navbar__contact_icon}
          />
        </div>
        <div className={styles.brand__header}>
          <h1 className={styles.brand__header_name}>Cara Jane Tran</h1>
          <p className={styles.brand__header_par}>
            Hi there <span className={styles.brand__header_wave}>ðŸ‘‹ </span>, I'm
            Cara! I'm a Junior Software Developer with proven experience in
            Software Testing based in Sydney, NSW.
          </p>
        </div>
      </div>
    </>
  );
};
